<br />
<strong><u>SERVEIS I ACTIVITATS: </u><br />
Programes de resid&egrave;ncia art&iacute;stica </strong><br />
&bull; Els artistes i les companyies professionals de m&uacute;sica, teatre i dansa poden utilitzar aquest equipament per a l&rsquo;elaboraci&oacute; i assaig dels seus espectacles i, posteriorment, oferir aquestes creacions a la ciutadania.<br />
