<br />
<strong>Programaci&oacute; d&rsquo;arts esc&egrave;niques </strong><br />
&bull; El CC la B&ograve;bila ofereix una programaci&oacute; d&rsquo;arts esc&egrave;niques (teatre, m&uacute;sica i dansa) d&rsquo;espectacles de petit format amb la col&middot;laboraci&oacute; de diferents agents del sector.<br />
Servei gratu&iuml;t / Activitat durant tot l&rsquo;any / Adre&ccedil;at a tota la poblaci&oacute;&nbsp;<br />
<br />
<strong>Cessi&oacute; dels espais del CC la B&ograve;bila </strong><br />
&bull; Es cedeixen els diferents espais del Centre per a la realitzaci&oacute; de diverses activitats. Entre d&rsquo;altres: teatre, m&uacute;sica, dansa, cinema, lectura, activitats de centres escolars, activitats d&rsquo;esplais i casals, activitats d&rsquo;entitats... Servei gratu&iuml;t / Activitat durant tot l&rsquo;any / Adre&ccedil;at a tota la poblaci&oacute;&nbsp;<br />
<br />
<strong>Activitats formatives i divulgatives</strong><br />
&bull; Realitzaci&oacute; de confer&egrave;ncies, xerrades, jornades i seminaris sobre diverses tem&agrave;tiques.<br />
Servei gratu&iuml;t / Activitat durant tot l&rsquo;any / Adre&ccedil;at a tota la poblaci&oacute;&nbsp;<br />
<br />
<strong>Tallers i cursos </strong><br />
&bull; Organitzats pel CC la B&ograve;bila o per entitats de la ciutat: teatre, dansa, gimn&agrave;stica, tecnologia de l&rsquo;espectacle, idiomes...<br />
