Programas de residencia art&iacute;stica </strong><br />
. Los artistas y las compa&ntilde;&iacute;as profesionales de m&uacute;sica, teatro y danza pueden utilizar este equipamiento para la elaboraci&oacute;n y ensayo de sus espect&aacute;culos y, posteriormente, ofrecer estas creaciones a la ciudadan&iacute;a.<br />
