', N'', N'Acc&eacute;s lliure<br />', 2180, N'C. Joan Pallarès', N'38', N'', N'', N'', N'', 1, N'Centre', 1, N'Centre, S. Josep, S.Feliu', N'08901', 101, N'L''Hospitalet de Llobregat', 8, N'Barcelona', NULL, N'', N'1900-01-01 00:00:00', N'1900-01-01 00:00:00', N'2019-09-01 00:00:00', N'', 0, N'', N'MUSEU HISTORIA L''HOSPITALET', N'', 0, NULL, N'http://www.museul-h.cat', N'cultura.museu@l-h.cat', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, N'La seu principal del Museu&nbsp;de l&#39;Hospitalet &eacute;s a la Casa Espanya, un edifici constru&iuml;t al segle XVI per Antic Llunell, membre d&#39;una rica fam&iacute;lia de terratinents de la localitat. Despr&eacute;s de successius enlla&ccedil;os matrimonials, la casa pass&agrave; a ser propietat de la fam&iacute;lia Espanya.<br />
<br />
Finalment, l&#39;Ajuntament de l&#39;Hospitalet la va adquirir per acollir-hi el museu. El 1975 fou declarat B&eacute; Cultural d&#39;Inter&egrave;s Nacional. Actualment acull exposicions temporals i els serveis del museu.<br />
<br />
El museu vol difondre i conservar el patrimoni cultural i material de l&#39;Hospitalet i fomentar-ne la identitat ciutadana, tot donant a con&egrave;ixer el passat, el present i el projecte de futur de la ciutat. El Museu de L&rsquo;Hospitalet participa en la Xarxa de Museus Locals que impulsa la Diputaci&oacute; de Barcelona.<br />
<br />
<strong>Fons del Museu:&nbsp;</strong><br />
<br />
Art contemporani, Art d&#39;altres cultures, Arts decoratives i aplicades, Avantguardes, Cultura popular tradicional, El m&oacute;n rural, Hist&ograve;ria local i comarcal, Modernisme, Noucentisme, Renaixement-Barroc, Tecnologia industrial, Tecnologia pre-industrial, Vida quotidiana<br />
<br />
<strong>Serveis:</strong> Activitats culturals i serveis pedag&ograve;gics i educatius<br />
<br />
<strong>Publicacions:</strong> Edici&oacute; de cat&agrave;legs de les exposicions&nbsp;<br />
<br />
<strong>Instal&bull;lacions:</strong> Jardins p&uacute;blics, Recepci&oacute;, Sales d&#39; exposicions, Sala de Consulta de l&rsquo;Arxiu Municipal de L&rsquo;Hospitalet- Arxiu Hist&ograve;ric, WC&nbsp;<br />
<br />
