', N'', N'Acceso libre', 2180, N'C. Joan Pallarès', N'38', N'', N'', N'', N'', 1, N'Centre', 1, N'Centre, S. Josep, S.Feliu', N'08901', 101, N'L''Hospitalet de Llobregat', NULL, N'Barcelona', NULL, N'', N'1900-01-01 00:00:00', N'1900-01-01 00:00:00', N'2019-09-01 00:00:00', N'', 0, N'', N'', N'', 0, NULL, N'http://www.museul-h.cat', N'cultura.museu@l-h.cat', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, N'La sede principal del Museo&nbsp;de L&#39;Hospitalet est&aacute; en la Casa Espa&ntilde;a, un edificio construido en el siglo XVI por Antic Llunell, miembro de una rica familia de terratenientes de la localidad. Despu&eacute;s de sucesivos enlaces matrimoniales, la casa pas&oacute; a ser propiedad de la familia Espanya.<br />
<br />
Finalmente, el Ayuntamiento de L&#39;Hospitalet la adquiri&oacute; para acoger el museo. En 1975 fue declarado Bien Cultural de Inter&eacute;s Nacional. Actualmente acoge exposiciones temporales y los servicios del museo.<br />
<br />
El museo quiere difundir y conservar el patrimonio cultural y material de L&#39;Hospitalet y fomentar la identidad ciudadana, dando a conocer el pasado, el presente y el proyecto de futuro de la ciudad. El Museo de L&rsquo;Hospitalet participa en la&nbsp;Red de Museos Locales que impulsa la Diputaci&oacute;n de Barcelona.<br />
<br />
<strong>Fondo del Museo: </strong><br />
<br />
Arte contempor&aacute;neo, Arte de otras culturas, Artes decorativas y aplicadas, Vanguardias, Cultura Popular tradicional, El mundo rural, Historia local y comarcal, Modernismo, Novecentismo, Renacimiento-Barroco, Tecnolog&iacute;a industrial, Tecnolog&iacute;a pre-industrial, Vida cotidiana<br />
<br />
<strong>Servicios:</strong> Actividades culturales y servicios pedag&oacute;gicos y educativos<br />
<br />
<strong>Publicaciones:</strong> Edici&oacute;n de cat&aacute;logos de las exposiciones<br />
<br />
<strong>Instalaciones:</strong> Jardines p&uacute;blicos, Recepci&oacute;n, Salas de exposiciones, Sala de Consulta del Archivo Municipal del Hospitalet- Archivo Hist&oacute;rico, WC<br />
