Dissabtes i diumenges d''11 a 14 h <br />
Dilluns i festius, tancat </p>', N'', N'Entrada gratu&iuml;ta', 2180, N'C.Joan Pallarès                                     ,', N'38', N'', N'', N'', N'', 1, N'Centre', 1, N'Centre, S. Josep, S.Feliu', N'08901', 101, N'L''Hospitalet de Llobregat', NULL, N'Barcelona', NULL, N'', N'1900-01-01 00:00:00', N'1900-01-01 00:00:00', N'2015-05-01 00:00:00', N'', 0, N'', N'', N'', 0, NULL, N'http://www.museul-h.cat', N'cultura.museu@l-h.cat', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, N'La seu principal del Museu d''Hist&ograve;ria de l''Hospitalet &eacute;s a la Casa Espanya, un edifici constru&iuml;t al segle XVI per Antic Llunell, membre d''una rica fam&iacute;lia de terratinents de la localitat. Despr&eacute;s de successius enlla&ccedil;os matrimonials, la casa pass&agrave; a ser propietat de la fam&iacute;lia Espanya. <br />
<br />
Finalment, l''Ajuntament de l''Hospitalet la va adquirir per acollir-hi el museu. El 1975 fou declarat B&eacute; Cultural d''Inter&egrave;s Nacional. Actualment acull exposicions temporals i els serveis del museu. <br />
<br />
El museu vol difondre i conservar el patrimoni cultural i material de l''Hospitalet i fomentar-ne la identitat ciutadana, tot donant a con&egrave;ixer el passat, el present i el projecte de futur de la ciutat. <br />
<br />
<strong>Fons del Museu:&nbsp;<br />
<br />
</strong>Art contemporani, Art d''altres cultures, Arts decoratives i aplicades, Avantguardes, Cultura popular tradicional, El m&oacute;n rural, Hist&ograve;ria local i comarcal, Modernisme, Noucentisme, Renaixement-Barroc, Tecnologia industrial, Tecnologia pre-industrial, Vida quotidiana <br />
<br />
<strong>Serveis:</strong> Activitats culturals i serveis pedag&ograve;gics i educatius<br />
<br />
<strong>Publicacions:</strong> Edici&oacute; de cat&agrave;legs de les exposicions&nbsp;<br />
<strong><br />
Instal&bull;lacions:</strong> Jardins p&uacute;blics, Recepci&oacute;, Sales d'' exposicions, Sala de Consulta de l&rsquo;Arxiu Municipal de L&rsquo;Hospitalet- Arxiu Hist&ograve;ric, WC&nbsp;<br />
<br />
<strong>Guia de Serveis Educatius:&nbsp;<br />
<br />
</strong><u>Rutes Urbanes</u> <br />
Itineraris per la ciutat per ampliar el coneixement sobre la hist&ograve;ria de l&rsquo;Hospitalet, passat i present: <br />
- Ruta Urbana: ''La Vila Vella'' <br />
- Ruta Urbana L''Hospitalet Industrial <br />
- Ruta Urbana Puig i Gairalt a Collblanc-La Torrassa <br />
- Ruta Urbana ''L''H 2010: La transformaci&oacute; de la ciutat'' <br />
<br />
<u>Visites Urbanes</u> <br />
Visita a edificis i equipaments de la ciutat emblem&agrave;tics per la seva relaci&oacute; amb la hist&ograve;ria de L&rsquo;Hospitalet: <br />
- Visita Urbana. Descobreix la F&agrave;brica Tecla Sala <br />
- Visita Urbana. Coneixes la Remunta? <br />
- Visita Urbana. Visita a l''Ajuntament&nbsp;<br />
<br />
<u>Visites comentades a les exposicions</u> <br />
S&rsquo;ofereixen visites guiades a les exposicions, per a grups escolars o qualsevol altre tipus de col&middot;lectiu adult o jove . Veure l&rsquo;oferta did&agrave;ctica en l&rsquo;agenda de les exposicions.', 424602, 4579412, N'41.3608335086553,2.09751221461199', NULL, 0, NULL)
