- Per fer qualsevol tipus d''obra dins de la nostra propietat (per &nbsp;exemple: tirar un env&agrave;, canvi de distribuci&oacute; interior, arranjament de lavabo i cuina, etc.) &eacute;s necessari demanar pr&egrave;viament el corresponent perm&iacute;s d''obres. Per m&eacute;s informaci&oacute; cal consultar la <a href="http://www3.amb.cat/normaurb2004/index.htm">Normativa Urban&iacute;stica Metropolitana</a> o b&eacute; al <a href="http://www.l-h.cat/detallEquipament.aspx?1%c6%92%c3%8b%c3%9ab%01%c2%b2%e2%80%94mc%e2%80%a2%00I%c3%88%00%19%e2%80%9a%24(b%e2%80%93%5d%c5%a0%c3%83%c2%a0%3e%c2%b6%e2%80%9c_%c2%abb%c3%8b%3d%c3%81%c3%b6%16%e2%80%93">Negociat Jur&iacute;dic Administratiu de Llic&egrave;ncies d''Obres</a>.', 2550, N'C. Migdia', N'5', N'', N'', N'5', N'', 3, N'Sant Josep', 1, N'Centre, S. Josep, S.Feliu', N'08901', 101, N'L''Hospitalet de Llobregat', 8, N'Barcelona', NULL, N'', N'1900-01-01 00:00:00', N'1900-01-01 00:00:00', N'2015-09-01 00:00:00', N'inspecció', 0, N'', N'DISCIPLINA URBANISTICA', N'', 0, NULL, N'', N'', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, N'S''encarrega del control i protecci&oacute; de la legalitat urban&iacute;stica<br />
<br />
<strong>Tipus d''infraccions urban&iacute;stiques</strong><br />
<br />
- Obres sense llic&egrave;ncies.<br />
- Obres que no s''ajusten a la llic&egrave;ncia demanada.<br />
- Usos indeguts (local convertit en habitatge).<br />
- Edificis e instal&middot;lacions en situaci&oacute; urban&iacute;stica que estiguin fora d''ordenaci&oacute; de la normativa urban&iacute;stica metropolitana.<br />
- Tancaments d''alumini i/o obra en terrasses i patis, cossos sortints habitables.<br />
<br />
<strong>Com actuem:</strong> <br />
<br />
- Suspensi&oacute; d''obres. <br />
- Requeriments de legalitzaci&oacute;. <br />
- Ordre de reposici&oacute; de la realitat f&iacute;sica alterada. <br />
- Multes coercitives. <br />
- Execuci&oacute; for&ccedil;osa. <br />
- Expedients sancionadors. <br />', 425468, 4579415, N'41.3609412806658,2.10786426443975', N'', 0, NULL)
INSERT INTO [dbo].[METLDIR] ([DIRINNOD], [DIRINIDI], [DIRDSNOM], [DIRDSSIG], [DIRDSCIF], [DIRDSACT], [DIRINCOL], [DIRINENT], [DIRIMPRE], [DIRDSHOR], [DIRDSTEL], [DIRDSOBS], [DIRCDCAR], [DIRDSCAR], [DIRDSNUM], [DIRDSBIS], [DIRDSESC], [DIRDSPIS], [DIRDSPOR], [DIRCDBAR], [DIRDSBAR], [DIRCDDIS], [DIRDSDIS], [DIRDSCDP], [DIRCDMUN], [DIRDSMUN], [DIRCDPRV], [DIRDSPRV], [DIRCDPAI], [DIRDSPAI], [DIRDTPUB], [DIRDTCAD], [DIRDTMAN], [DIRDSPCL], [DIRWNCON], [DIRDSCOM], [DIRCDAIDA1], [DIRCDAIDA2], [DIRWNTIP], [DIRDTALT], [DIRDSWEB], [DIRDSEML], [DIRDTDIN], [DIRDTDAC], [DIRDSNRE], [DIRDTREG], [DIRDSEST], [DIRDSAMB], [DIRDSSIT], [DIRDSSOC], [DIRDSPRE], [DIRDSAPR], [DIRDSUSU], [DIRSWVIS], [DIRDSDES], [DIRCDCOX], [DIRCDCOY], [DIRDSGPS], [DIRDSXSO], [DIRSWACC], [DIRDSOBS_RSO]) VALUES (CAST(81096 AS Decimal(18, 0)), 2, N'Negociado de Disciplina urban&iacute;stica', N'', N'', NULL, NULL, NULL, NULL, N'Lunes a viernes: 8.30 a 13.30 h<br />', N'', N'-&nbsp;En cuanto a la colocaci&oacute;n de tendederos de ropa, aparatos de aire acondicionado y antenas parab&oacute;licas, hace falta consultar la <a href="http://www.l-h.cat/utils/obreFitxer.aspx?%c6%92%c3%88%02%e2%80%9d%19%c3%a8%c3%87%c5%bezV%c3%83A%c3%82%00%14oNq%5d%e2%80%bai%c2%bd%07%c5%a18%c3%9a%c2%a0k%c3%ab ">Ordenanza del Civismo y la Convivencia</a>&nbsp;del Ayuntamiento de L''Hospitalet que entr&oacute; en vigor en abril del 2005.<br />
-&nbsp;Para hacer cualquier tipo de obra dentro de nuestra propiedad (por ejemplo: tirar un tabique, cambio de distribuci&oacute;n interior, arreglo de lavabo y cocina, etc.) es necesario pedir previamente el correspondiente permiso de obras. Para m&aacute;s informaci&oacute;n hay que consultar la <a href="http://www3.amb.cat/normaurb2004/index.htm">Normativa Urban&iacute;stica Metropolitana</a> o bien al <a href="http://www.l-h.cat/detallEquipament.aspx?1%c6%92%c3%8b%c3%9ab%01%c2%b2%e2%80%94mc%e2%80%a2%00I%c3%88%00%19%e2%80%9a%24(b%e2%80%93%5d%c5%a0%c3%83%c2%a0%3e%c2%b6%e2%80%9c_%c2%abb%c3%8b%3d%c3%81%c3%b6%16%e2%80%93">Negociado Jur&iacute;dico Administrativo de Licencias de Obras</a>.', 2550, N'C. Migdia', N'5', N'', N'', N'5', N'', 3, N'Sant Josep', 1, N'Centre, S. Josep, S.Feliu', N'08901', 101, N'L''Hospitalet de Llobregat', NULL, N'Barcelona', NULL, N'', N'1900-01-01 00:00:00', N'1900-01-01 00:00:00', N'2015-09-01 00:00:00', N'inspección', 0, N'', N'', N'', 0, NULL, N'', N'', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, N'Se encarga del control y protecci&oacute;n de la legalidad urban&iacute;stica<br />
<br />
<strong>Tipo de infracciones urban&iacute;sticas</strong><br />
<br />
- Obras sin licencias.<br />
- Obras que no se ajustan a la licencia pedida.<br />
- Usos indebidos (local convertido en vivienda).<br />
- Edificios e instalaciones en situaci&oacute;n urban&iacute;stica que est&eacute;n fuera de ordenaci&oacute;n de la normativa urban&iacute;stica metropolitana.<br />
- Cierres de aluminio y/o obra en terrazas y patios, cuerpos salientes habitables.<br />
<br />
<strong>Como actuamos: <br />
</strong><br />
- Suspensi&oacute;n de obras. <br />
- Requerimientos de legalizaci&oacute;n. <br />
- Orden de reposici&oacute;n de la realidad f&iacute;sica alterada. <br />
- Multas coercitivas. <br />
- Ejecuci&oacute;n forzosa. <br />
- Expedientes sancionadores. <br />', 425468, 4579415, N'41.3609412806658,2.10786426443975', N'', 0, NULL)
