INSERT INTO [dbo].[METLDIR] ([DIRINNOD], [DIRINIDI], [DIRDSNOM], [DIRDSSIG], [DIRDSCIF], [DIRDSACT], [DIRINCOL], [DIRINENT], [DIRIMPRE], [DIRDSHOR], [DIRDSTEL], [DIRDSOBS], [DIRCDCAR], [DIRDSCAR], [DIRDSNUM], [DIRDSBIS], [DIRDSESC], [DIRDSPIS], [DIRDSPOR], [DIRCDBAR], [DIRDSBAR], [DIRCDDIS], [DIRDSDIS], [DIRDSCDP], [DIRCDMUN], [DIRDSMUN], [DIRCDPRV], [DIRDSPRV], [DIRCDPAI], [DIRDSPAI], [DIRDTPUB], [DIRDTCAD], [DIRDTMAN], [DIRDSPCL], [DIRWNCON], [DIRDSCOM], [DIRCDAIDA1], [DIRCDAIDA2], [DIRWNTIP], [DIRDTALT], [DIRDSWEB], [DIRDSEML], [DIRDTDIN], [DIRDTDAC], [DIRDSNRE], [DIRDTREG], [DIRDSEST], [DIRDSAMB], [DIRDSSIT], [DIRDSSOC], [DIRDSPRE], [DIRDSAPR], [DIRDSUSU], [DIRSWVIS], [DIRDSDES], [DIRCDCOX], [DIRCDCOY], [DIRDSGPS], [DIRDSXSO], [DIRSWACC], [DIRDSOBS_RSO]) VALUES (CAST(81100 AS Decimal(18, 0)), 1, N'Unitat de Manteniment d&#39;Instal&middot;lacions&nbsp;d&#39;Edificis', N'', N'', NULL, NULL, NULL, NULL, N'<br />
', N'', N'Aquest departament municipal s&#39;encarrega del manteniment d&#39;edificis i solars municipals. En cas de tractar-se d&#39;un edifici, habitatge o solar particular teniu en compte la seg&uuml;ent informaci&oacute;:<br />
<ul>
 <li>
  Es responsabilitat dels propietaris fer revisions i reparacions al seu edifici per tal de mantenir-los en les condicions m&iacute;nimes de salubritat i seguretat.</li>
 <li>
  Qu&egrave; hem de fer quan tenim sospita o v&egrave;iem un desperfecte a l&rsquo;edifici? La comunitat de propietaris ha de posar-se en contacte amb un t&egrave;cnic particular, per tal que faci una revisi&oacute; i una proposta de reparaci&oacute;.</li>
 <li>
  Qu&egrave; hem de fer quan hi ha humitats i/o fuites d&rsquo;aigua? Posar-se en contacte amb un t&egrave;cnic particular per fer les reparacions al m&eacute;s aviat possible per evitar mals majors.</li>
</ul>', 2550, N'C. Migdia', N'5', N'', N'', N'03', N'', 3, N'Sant Josep', 1, N'Centre, S. Josep, S.Feliu', N'08901', 101, N'L''Hospitalet de Llobregat', 8, N'Barcelona', NULL, N'', N'1900-01-01 00:00:00', N'1900-01-01 00:00:00', N'2015-09-01 00:00:00', N'', 0, N'', N'HABITATGE', N'', 0, NULL, N'', N'', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, N'- Patologies en edificacions municipals&nbsp;(fa&ccedil;anes, balcons i altres elements exteriors, interiors i d&rsquo;estructura).<br />
- Solars municipals en mal estat de conservaci&oacute; tant a l&rsquo;interior com el seu tancament a la via p&uacute;blica.<br />
- Finques municipals en estat deficient de conservaci&oacute;.<br />
<br />
<strong>Com actuem</strong><br />
<br />
- Ordres d&rsquo;execuci&oacute; de reparaci&oacute; i consolidaci&oacute; d&rsquo;edificacions, de neteja i de tancament de solars.<br />
- Declaracions d&rsquo;estat ru&iuml;n&oacute;s.<br />
- Ordres de desallotjament i adopci&oacute; de mesures de seguretat en casos d&rsquo;urg&egrave;ncia.<br />
- Expedients sancionadors.<br />
- Multes coercitives.<br />
- Execuci&oacute; for&ccedil;osa.<br />', 425468, 4579415, N'41.3609412806658,2.10786426443975', N'', 0, N'')
INSERT INTO [dbo].[METLDIR] ([DIRINNOD], [DIRINIDI], [DIRDSNOM], [DIRDSSIG], [DIRDSCIF], [DIRDSACT], [DIRINCOL], [DIRINENT], [DIRIMPRE], [DIRDSHOR], [DIRDSTEL], [DIRDSOBS], [DIRCDCAR], [DIRDSCAR], [DIRDSNUM], [DIRDSBIS], [DIRDSESC], [DIRDSPIS], [DIRDSPOR], [DIRCDBAR], [DIRDSBAR], [DIRCDDIS], [DIRDSDIS], [DIRDSCDP], [DIRCDMUN], [DIRDSMUN], [DIRCDPRV], [DIRDSPRV], [DIRCDPAI], [DIRDSPAI], [DIRDTPUB], [DIRDTCAD], [DIRDTMAN], [DIRDSPCL], [DIRWNCON], [DIRDSCOM], [DIRCDAIDA1], [DIRCDAIDA2], [DIRWNTIP], [DIRDTALT], [DIRDSWEB], [DIRDSEML], [DIRDTDIN], [DIRDTDAC], [DIRDSNRE], [DIRDTREG], [DIRDSEST], [DIRDSAMB], [DIRDSSIT], [DIRDSSOC], [DIRDSPRE], [DIRDSAPR], [DIRDSUSU], [DIRSWVIS], [DIRDSDES], [DIRCDCOX], [DIRCDCOY], [DIRDSGPS], [DIRDSXSO], [DIRSWACC], [DIRDSOBS_RSO]) VALUES (CAST(81100 AS Decimal(18, 0)), 2, N'Unidad de Mantenimiento de Instalaciones&nbsp;de Edificios', N'', N'', NULL, NULL, NULL, NULL, N'<br />
', N'', N'-&nbsp;Es responsabilidad de los propietarios hacer revisiones y reparaciones en su edificio con el fin de mantenerlas en las condiciones m&iacute;nimas de salubridad y seguridad.<br />
- &iquest;Qu&eacute; tenemos que hacer cuando tenemos sospecha o vemos un desperfecto en el edificio? La comunidad de propietarios tiene que ponerse en contacto con un t&eacute;cnico particular, a fin de que haga una revisi&oacute;n y una propuesta de reparaci&oacute;n.<br />
- &iquest;Qu&eacute; tenemos que hacer cuando hay humedad y/o escapes de agua? Ponerse en contacto con un t&eacute;cnico particular para hacer las reparaciones lo antes posible para evitar da&ntilde;os mayores.', 2550, N'C. Migdia', N'5', N'', N'', N'03', N'', 3, N'Sant Josep', 1, N'Centre, S. Josep, S.Feliu', N'08901', 101, N'L''Hospitalet de Llobregat', NULL, N'Barcelona', NULL, N'', N'1900-01-01 00:00:00', N'1900-01-01 00:00:00', N'2015-09-01 00:00:00', N'', 0, N'', N'', N'', 0, NULL, N'', N'', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, N'- Patolog&iacute;as en edificaciones (fachadas, balcones y otros elementos exteriores, interiores y de estructura).<br />
- Solares en mal estado de conservaci&oacute;n tanto en el interior como su cierre en la v&iacute;a p&uacute;blica.<br />
- Fincas en estado deficiente de conservaci&oacute;n.<br />
<br />
<strong>Como actuamos </strong><br />
<br />
- &Oacute;rdenes de ejecuci&oacute;n de reparaci&oacute;n y consolidaci&oacute;n de edificaciones, de limpieza y de cierre de solares.<br />
- Declaraciones de estado ruinoso.<br />
- &Oacute;rdenes de desalojamiento y adopci&oacute;n de medidas de seguridad en casos de urgencia.<br />
- Expedientes sancionadores.<br />
- Multas coercitivas.<br />
- Ejecuci&oacute;n forzosa.<br />', 425468, 4579415, N'41.3609412806658,2.10786426443975', N'', 0, N'')
INSERT INTO [dbo].[METLDIR] ([DIRINNOD], [DIRINIDI], [DIRDSNOM], [DIRDSSIG], [DIRDSCIF], [DIRDSACT], [DIRINCOL], [DIRINENT], [DIRIMPRE], [DIRDSHOR], [DIRDSTEL], [DIRDSOBS], [DIRCDCAR], [DIRDSCAR], [DIRDSNUM], [DIRDSBIS], [DIRDSESC], [DIRDSPIS], [DIRDSPOR], [DIRCDBAR], [DIRDSBAR], [DIRCDDIS], [DIRDSDIS], [DIRDSCDP], [DIRCDMUN], [DIRDSMUN], [DIRCDPRV], [DIRDSPRV], [DIRCDPAI], [DIRDSPAI], [DIRDTPUB], [DIRDTCAD], [DIRDTMAN], [DIRDSPCL], [DIRWNCON], [DIRDSCOM], [DIRCDAIDA1], [DIRCDAIDA2], [DIRWNTIP], [DIRDTALT], [DIRDSWEB], [DIRDSEML], [DIRDTDIN], [DIRDTDAC], [DIRDSNRE], [DIRDTREG], [DIRDSEST], [DIRDSAMB], [DIRDSSIT], [DIRDSSOC], [DIRDSPRE], [DIRDSAPR], [DIRDSUSU], [DIRSWVIS], [DIRDSDES], [DIRCDCOX], [DIRCDCOY], [DIRDSGPS], [DIRDSXSO], [DIRSWACC], [DIRDSOBS_RSO]) VALUES (CAST(81101 AS Decimal(18, 0)), 1, N'Negociat d&#39;Informaci&oacute; Urban&iacute;stica', N'', N'', NULL, NULL, NULL, NULL, N'Dilluns a divendres: 9-13 h<br />
', N'', N'<p>
 - Donar informaci&oacute; de forma presencial del Planejament aprovat a la ciutat. La normativa vigent &eacute;s la del Pla General Metropolit&agrave; (PGM) aprovat definitivament per la comissi&oacute; provincial d&rsquo;urbanisme de Barcelona el 14 de juliol de 1976 i publicada en el BOP el 19 de juliol de 1976. Aquest es pot consultar a la web de <a href="http://www3.amb.cat/normaurb2004/index.htm">l&#39;&Agrave;rea Metropolitana de Barcelona</a>.&nbsp;<br />
 - Donar informaci&oacute; de tots els plans especials de reformes interior PERI aprovats definitivament a la ciutat. Tamb&eacute; es poden consultar a la web d&#39;aquest <a href="http://www.l-h.cat/infoUrbanistica.asp?id=1">Ajuntament</a>.<br />
 - Donar informaci&oacute; a les persones interessades en la compra d&rsquo;una vivenda de la situaci&oacute; urban&iacute;stica i possible afectaci&oacute; de la finca.<br />
 - Lliurament d&rsquo;informes o certificats pr&egrave;via sol&bull;licitud per inst&agrave;ncia presentada en el registre general de l&rsquo;ajuntament previ pagament de les taxes municipals, que pels informes &eacute;s de 35,52 euros i pels certificats de 63,43 euros.<br />
 - Enviament per fax de pl&agrave;nols d&rsquo;empla&ccedil;ament amb la qualificaci&oacute; urban&iacute;stica. La sol&bull;licitud &eacute;s pot fer per via telef&ograve;nica, per e-mail o fax.<br />
 - El pl&agrave;nol d&rsquo;informaci&oacute; urban&iacute;stica tamb&eacute; &eacute;s pot obtenir des de la p&agrave;gina web de l&rsquo;ajuntament en &ldquo;<a href="http://www.l-h.cat/infoUrbanistica.asp?id=1">pl&agrave;nol d&rsquo;informaci&oacute; urban&iacute;stica</a>&rdquo;<br />
 - El departament disposa de pl&agrave;nols de la ciutat amb el nomencl&agrave;tor a color i a escala 1:5000. Preu 5,04 euros.</p>', 2550, N'C. Migdia', N'0005', N'', N'', N'05', N'', 3, N'Sant Josep', 1, N'Centre, S. Josep, S.Feliu', N'08901', 101, N'L''Hospitalet de Llobregat', 8, N'Barcelona', NULL, N'', N'1900-01-01 00:00:00', N'1900-01-01 00:00:00', N'2007-02-01 00:00:00', N'', 0, N'', N'INFORMACIO URBANISTICA', N'', 0, NULL, N'', N'', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, N'Centralitzar la informaci&oacute; urban&iacute;stica generada a les diferents depend&egrave;ncies municipals i informar sobre la mateixa.<br />', 425468, 4579415, N'41.3609412806658,2.10786426443975', N'', 0, NULL)
INSERT INTO [dbo].[METLDIR] ([DIRINNOD], [DIRINIDI], [DIRDSNOM], [DIRDSSIG], [DIRDSCIF], [DIRDSACT], [DIRINCOL], [DIRINENT], [DIRIMPRE], [DIRDSHOR], [DIRDSTEL], [DIRDSOBS], [DIRCDCAR], [DIRDSCAR], [DIRDSNUM], [DIRDSBIS], [DIRDSESC], [DIRDSPIS], [DIRDSPOR], [DIRCDBAR], [DIRDSBAR], [DIRCDDIS], [DIRDSDIS], [DIRDSCDP], [DIRCDMUN], [DIRDSMUN], [DIRCDPRV], [DIRDSPRV], [DIRCDPAI], [DIRDSPAI], [DIRDTPUB], [DIRDTCAD], [DIRDTMAN], [DIRDSPCL], [DIRWNCON], [DIRDSCOM], [DIRCDAIDA1], [DIRCDAIDA2], [DIRWNTIP], [DIRDTALT], [DIRDSWEB], [DIRDSEML], [DIRDTDIN], [DIRDTDAC], [DIRDSNRE], [DIRDTREG], [DIRDSEST], [DIRDSAMB], [DIRDSSIT], [DIRDSSOC], [DIRDSPRE], [DIRDSAPR], [DIRDSUSU], [DIRSWVIS], [DIRDSDES], [DIRCDCOX], [DIRCDCOY], [DIRDSGPS], [DIRDSXSO], [DIRSWACC], [DIRDSOBS_RSO]) VALUES (CAST(81101 AS Decimal(18, 0)), 2, N'Negociado de Informaci&oacute;n Urban&iacute;stica', N'', N'', NULL, NULL, NULL, NULL, N'Lunes a viernes: 9-13 h<br />
', N'', N'<p>
 - Dar informaci&oacute;n de forma presencial del Planeamiento aprobado en la ciudad. La normativa vigente es la del Plan General Metropolitano (PGM) aprobado definitivamente por la comisi&oacute;n provincial de urbanismo de Barcelona el 14 de julio de 1976 y publicada en el BOP el 19 de julio de 1976. &Eacute;ste se puede consultar&nbsp;en la web del <a href="http://www3.amb.cat/normaurb2004/index.htm">&Aacute;rea Metropolitana de Barcelona</a>.<br />
 - Dar informaci&oacute;n de todos los planes especiales de reformas interior PERI aprobados definitivamente en la ciudad. Tambi&eacute;n se pueden consultar a la web de este <a href="http://www.l-h.cat/infoUrbanistica_2.asp?id=2">Ayuntamiento</a> .<br />
 - Dar informaci&oacute;n a las personas interesadas en la compra de una vivienda de la situaci&oacute;n urban&iacute;stica y posible afectaci&oacute;n de la finca.<br />
 - Entrega de informes o certificados previa solicitud por instancia presentada en el registro general del ayuntamiento previo pago de las tasas municipales, que para los informes es de 35,52 euros y para los certificados de 63,43 euros.<br />
 - Env&iacute;o por fax de planos de emplazamiento con la calificaci&oacute;n urban&iacute;stica. La solicitud se puede hacer por v&iacute;a telef&oacute;nica, por e-mail o fax.<br />
