La Junta Arbitral de Consum de l&#39;Ajuntament de l&#39;Hospitalet, administra i gestiona la resoluci&oacute; de conflictes en mat&egrave;ria de consum mitjan&ccedil;ant la mediaci&oacute; i arbitratge.<br />
<br />
Caracter&iacute;stiques de l&#39;arbitratge de consum:<br />
<br />
<strong>1. Voluntarietat</strong><br />
&Eacute;s un sistema extrajudicial de resoluci&oacute; de conflictes de car&agrave;cter voluntari pel qual les parts, lliurement, confien la resoluci&oacute; del cas a la Junta Arbitral i queden vinculades per la resoluci&oacute; que es pugui dictar, anomenada laude.<br />
<br />
<strong>2. Rapidesa </strong><br />
El termini per dictar el laude &eacute;s de sis mesos des de l&rsquo;inici del procediment arbitral.<br />
<br />
<strong>3. Imparcialitat</strong><br />
Els &agrave;rbitres que s&oacute;n designats per la Junta Arbitral de Consum, actuen en l&rsquo;exercici de la seva funcions amb independ&egrave;ncia, imparcialitat i confidencialitat.<br />
<br />
<strong>4. Efic&agrave;cia i executivitat</strong><br />
El laude t&eacute; l&#39;efecte de cosa jutjada, &eacute;s d&#39;obligat compliment i t&eacute; els mateixos efectes que una sent&egrave;ncia judicial. Si no es compleix el laude, la part perjudicada podr&agrave; demanar-ne al jutjat el compliment en via executiva, de forma similar a una sent&egrave;ncia judicial.<br />
<br />
<strong>5. Economia</strong><br />
El sistema arbitral &eacute;s gratu&iuml;t llevat de determinades proves que puguin demanar les parts.<br />
<br />
<strong>6. Senzillesa</strong><br />
A l&#39;arbitratge de consum les parts es representen i defensen elles mateixes, sense necessitat d&#39;assist&egrave;ncia d&#39;advocat ni procurador.<br />', 424863, 4579455, N'41.3612452240153,2.10062694679825', N'', 0, N'')
