La Junta Arbitral de Consumo del Ayuntamiento de L&rsquo;Hospitalet, administra y gestiona la resoluci&oacute;n de conflictos en materia de consumo a trav&eacute;s de la mediaci&oacute;n y el arbitraje.<br />
<br />
Caracter&iacute;sticas del arbitraje de consumo:<br />
<br />
<strong>1. Voluntariedad</strong><br />
Es un sistema extrajudicial de resoluci&oacute;n de conflictos de car&aacute;cter voluntario mediante el cual las partes, libremente, conf&iacute;an la resoluci&oacute;n del caso a la Junta Arbitral y quedan vinculadas por la resoluci&oacute;n que se pueda dictar, que se denomina laudo.<br />
<br />
<strong>2. Rapidez</strong><br />
El plazo para dictar el laudo es de seis meses contados desde el inicio del procedimiento arbitral.<br />
<br />
<strong>3. Imparcialidad</strong><br />
Los &aacute;rbitros que son designados por la Junta Arbitral de Consumo act&uacute;an en el ejercicio de sus funciones con independencia, imparcialidad y confidencialidad.<br />
<br />
<strong>4. Eficacia y ejecutividad</strong><br />
El laudo tiene el efecto de cosa juzgada, es de obligado cumplimiento y tiene los mismos efectos que una sentencia judicial. Si el laudo no se cumple, la parte perjudicada podr&aacute; pedir en el juzgado su cumplimiento en v&iacute;a ejecutiva, de forma similar a una sentencia judicial.<br />
<br />
<strong>5. Econom&iacute;a</strong><br />
El sistema arbitral es gratuito salvo determinadas pruebas que puedan pedir las partes.<br />
<br />
<strong>6. Sencillez</strong><br />
En el arbitraje de consumo las partes se representan y defienden a si mismas, sin necesidad de asistencia de abogado ni procurador.<br />
<br />', 424863, 4579455, N'41.3612452240153,2.10062694679825', N'', 0, N'')
