', N'', N'', 1000, N'C. Cobalt', N'0057', N'', N'', N'02', N'', 1, N'Centre', 1, N'Centre, S. Josep, S.Feliu', N'08907', 101, N'L''Hospitalet de Llobregat', NULL, N'Barcelona', NULL, N'', N'1900-01-01 00:00:00', N'1900-01-01 00:00:00', N'2019-09-01 00:00:00', N'', 0, N'', N'', N'', 0, NULL, N'', N'puntsalutjove@l-h.cat', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, N'El Negociado de Salud comunitaria realiza un conjunto de actuaciones, prestaciones y servicios destinados a fomentar la salud individual y colectiva y a impulsar la adopci&oacute;n de estilos de vida saludables por medio de las intervenciones adecuadas en materia de informaci&oacute;n, comunicaci&oacute;n y educaci&oacute;n sanitarias con el objetivo de conseguir que la poblaci&oacute;n de nuestra ciudad tenga mejor salud y calidad de vida.<br />
