Es poden cursar tot tipus de denúncies, excepte les adreçades contra una persona física, ja que aquestes corresponen als Mossos d''Esquadra.

Entre les seves tasques, la Guàrdia Urbana sovint és el servei que cobreix en primera instància tot tipus de serveis relacionats amb la violència de gènere i en coordinació amb altres cossos policials, sobretot amb el Cos de Mossos d''Esquadra. Ofereix: suport i valoració de les primeres necessitats i acompanyaments als centres adients de caràcter sanitari i/o assistencial. 
En els casos de necessitat d''acolliment urgent en horari nocturn o festius, hi ha establerta una reserva de places amb el Centre Municipal d''Emergències.', N'GUARDIA URBANA', N'', 0, NULL, N'', N'guardiaurbana@l-h.cat', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, N'', 425468, 4579415, N'41.3609412806658,2.10786426443975', N'', 0, N'')
